import { BrowserRouter, Routes, Route, useParams } from "react-router-dom";
import ListPelanggan from "./components/ListPelanggan";
import TambahPelanggan from "./components/TambahPelanggan";
import EditPelanggan from "./components/EditPelanggan";

const { id } = useParams();

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<ListPelanggan />} />
        <Route path="tambah" element={<TambahPelanggan />} />
        <Route path="edit/{id}" element={<EditPelanggan />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
